import { RouterProvider, createBrowserRouter } from "react-router-dom";
import EditBranchPage from "./pages/EditBranch";
import ErrorPage from "./pages/Error";
import BranchDetailPage, {
  loader as branchDetailLoader,
  action as deleteBranchAction,
} from "./pages/BranchDetail";
import BranchesPage, { loader as branchesLoader } from "./pages/Branches";
import BranchesRootLayout from "./pages/BranchesRoot";
import HomePage from "./pages/Home";
import NewBranchPage from "./pages/NewBranch";
import RootLayout from "./pages/Root";
import { action as manipulateBranchAction } from "./components/branches/BranchForm";
import NewsletterPage, { action as newsletterAction } from "./pages/Newsletter";

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      { index: true, element: <HomePage /> },
      {
        path: "branches",
        element: <BranchesRootLayout />,
        children: [
          {
            index: true,
            element: <BranchesPage />,
            loader: branchesLoader,
          },
          {
            path: ":branchno",
            id: "branch-detail",
            loader: branchDetailLoader,
            children: [
              {
                index: true,
                element: <BranchDetailPage />,
                // action: deleteBranchAction, // Uncomment if needed
              },
              {
                path: "edit",
                element: <EditBranchPage />,
                // action: manipulateBranchAction, // Uncomment if needed
              },
            ],
          },
          {
            path: "new",
            element: <NewBranchPage />,
            action: manipulateBranchAction,
          },
        ],
      },
      {
        path: "newsletter",
        element: <NewsletterPage />,
        action: newsletterAction,
      },
    ],
  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
